INSERT INTO `abouts` (`id`, `content`, `page`, `created_at`, `updated_at`) VALUES (1,'<p class=\"MsoNormal\" style=\"text-align: right;\" align=\"right\"><span style=\"font-family: \'B Nazanin\';\">هدف مرسیز براین است تا با ارائه کالاهای با کیفیت و درعین حال با قیمت مناسب امکان خرید را برای کلیه اقشار جامعه مهیا سازد.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right;\" align=\"right\"><span dir=\"RTL\" lang=\"FA\" style=\"font-family: \'B Nazanin\'; mso-bidi-language: FA;\">ما بیش از 4000 کالای متنوع در دسته بندی های گوناگون شامل لبنیات ِ خواروبار<span style=\"mso-spacerun: yes;\">&nbsp; </span>ِ میوه و سبزیجات تازه ِ مواد پروتئینی ِ نان <span style=\"mso-spacerun: yes;\">&nbsp;</span>ِ محصولات بهداشتی <span style=\"mso-spacerun: yes;\">&nbsp;</span>ِ نوشیدنی های سرد و ... را به صورت آنلاین عرضه میکنیم و شما امکان این را دارید که به یک باره تمامی اجناس مورد نیاز خودرا تهیه نمایید.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right;\" align=\"right\"><span dir=\"RTL\" lang=\"FA\" style=\"font-family: \'B Nazanin\'; mso-bidi-language: FA;\">مرسیز دسترسی کارمندان به کاربران را محدود نموده و هر فرد بنا به مسئولیت خود به میزان مورد نیاز به اطلاعات دسترسی خواهد داشت.</span></p>','about',NULL,'2021-03-14 12:59:55'),(2,'<p class=\"MsoNormal\" style=\"text-align: right;\" align=\"right\"><strong><span dir=\"RTL\" lang=\"FA\" style=\"font-size: 12.0pt; line-height: 107%; font-family: \'B Nazanin\'; mso-bidi-language: FA;\">قوانین و مقررات:</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right;\" align=\"right\"><span dir=\"RTL\" lang=\"FA\" style=\"font-family: \'B Nazanin\'; mso-bidi-language: FA;\">1_ هرگونه نقص و عیب فنی بایستی هنگام<span style=\"mso-spacerun: yes;\">&nbsp; </span>تحویل گرفتن سفارش ب متصدی تحویل کالا اعلام و مرجوع گردد.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right;\" align=\"right\"><span dir=\"RTL\" lang=\"FA\" style=\"font-family: \'B Nazanin\'; mso-bidi-language: FA;\">2_ مسئولیت وارد کردن اطلاعات اشتباه و غیرواقعی آدرس ِ شماره تلفن<span style=\"mso-spacerun: yes;\">&nbsp; </span>ِ ایمیل<span style=\"mso-spacerun: yes;\">&nbsp; </span>ِ به عهده ی خود مشتری می باشد. </span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right;\" align=\"right\"><span dir=\"RTL\" lang=\"FA\" style=\"font-family: \'B Nazanin\'; mso-bidi-language: FA;\">3_ هنگام سفارش ثبت کالا یک شماره معتبر و قابل دسترس الزامی است.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right;\" align=\"right\"><span dir=\"RTL\" lang=\"FA\" style=\"font-family: \'B Nazanin\'; mso-bidi-language: FA;\">4_ هرگونه بی احترامی و استفاده از الفاظ غیرادبی توسط پلیس فتا و مراجع قانونی قابل پیگیری می باشد.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: right;\" align=\"right\"><span dir=\"RTL\" lang=\"FA\" style=\"font-family: \'B Nazanin\'; mso-bidi-language: FA;\">5_ برای اطلاع رسانی رویدادها و خدمات ِ برای اعضای وب سایت ایمیل یا پیامک ارسال می شود. در صورتی ک کاربران تمایل به دریافت این گونه ایمیل ها نداشته باشند می توانند با استفاده از لینک مربوط به لغو اشتراک خبرنامه در انتهای ایمیل دریافتی اقدام نمایند. </span></p>','privacy',NULL,'2021-03-14 13:04:19'),(3,'<div class=\"text-justify\" style=\"box-sizing: border-box; color: #212121; font-family: IRANSans, iranyekan, -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, \'Noto Sans\', sans-serif, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\'; font-size: 16px; background-color: #ffffff; text-align: justify !important;\">\r\n<div class=\"text-justify w-100\" style=\"box-sizing: border-box; width: 851.406px;\">\r\n<p class=\"text-justify\" style=\"box-sizing: border-box; line-height: 1.3;\"><span style=\"font-size: 10pt; font-family: georgia, palatino, serif;\">چنانچه بعد از ثبت سفارش از خرید خود منصرف شده اید و یا نیاز به تغییر در سفارش پیش از ارسال کالا وجود دارد، درخواست خود را به واحد پشتیبانی&nbsp; از طریق شماره تلفن 33679779 اطلاع دهید. اگر در هنگام تحویل از کالاهای دریافتی خود ناراضی بودید، می توانید درخواست مرجوعی خود را به واحد پشتیبانی اطلاع دهید. پس از تایید نهایی توسط کارشناسان مطابق آیین نامه مرجوعی، در صورت احراز شرایط، کالای مذکور مرجوع خواهد شد.</span></p>\r\n<p class=\"h5 font-weight-bold my-16\" style=\"box-sizing: border-box; line-height: 1.3; font-size: 1.25rem; text-align: right; margin-bottom: 1rem !important; margin-top: 1rem !important;\"><span style=\"font-size: 10pt; font-family: georgia, palatino, serif;\">به منظور مرجوع کردن اقلام یک سفارش باید نکات زیر را مد نظر قرار داد</span></p>\r\n<ul class=\"list-unstyled\" style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; padding-right: 0px; list-style: none; text-align: right;\">\r\n<li class=\"my-8\" style=\"box-sizing: border-box; margin-top: 0.5rem !important; margin-bottom: 0.5rem !important; line-height: 1.3;\">\r\n<p><span style=\"font-size: 10pt; font-family: georgia, palatino, serif;\">موارد مربوط به سلامت کالاها، عدم تطابق کالاهای دریافتی با اقلام سفارش گذاری شده، ناقص بودن سفارش، سپری شدن تاریخ انقضا و یا مخدوش بودن بسته بندی اقلام سفارش باید در هنگام تحویل گرفتن کالا چک شود و سپس کد تحویل به مامور ارسال کالا تحویل داده شود. در صورت وجود هر گونه ایراد و یا اشکالی به واحد پشتیبانی مرسیز اطلاع داده شود.</span></p>\r\n</li>\r\n<li class=\"my-8\" style=\"box-sizing: border-box; margin-top: 0.5rem !important; margin-bottom: 0.5rem !important; line-height: 1.3;\">\r\n<p><span style=\"font-size: 10pt; font-family: georgia, palatino, serif;\">بسته بندی کالا در هنگام مرجوعی باید کاملا سالم بوده و قابل فروش باشد. کالاهای یخچالی و فاسد شدنی که دارای دوره مصرف کوتاهی هستند محدودیت تاریخ نیز در شرایط قابل فروش بودن موثر است.</span></p>\r\n</li>\r\n<li class=\"my-8\" style=\"box-sizing: border-box; margin-top: 0.5rem !important; margin-bottom: 0.5rem !important; line-height: 1.3;\">\r\n<p><span style=\"font-size: 10pt; font-family: georgia, palatino, serif;\">در خصوص کالاهایی مانند گوشت و مرغ برچسب روی کالا نیز باید حتما وجود داشته باشد.</span></p>\r\n</li>\r\n<li class=\"my-8\" style=\"box-sizing: border-box; margin-top: 0.5rem !important; margin-bottom: 0.5rem !important; line-height: 1.3;\">\r\n<p><span style=\"font-size: 10pt; font-family: georgia, palatino, serif;\">در خصوص کالاهای آرایشی و بهداشتی بالاخص کالاهای مراقبت پوست و مو حتما قبل از خرید نسبت به دریافت مشاوره اقدام نمایید. این کالاها با توجه به ماهیت بهداشتی قابلیت مرجوعی ندارند.</span></p>\r\n</li>\r\n<li class=\"my-8\" style=\"box-sizing: border-box; margin-top: 0.5rem !important; margin-bottom: 0.5rem !important; line-height: 1.3;\">\r\n<p><span style=\"font-size: 10pt; font-family: georgia, palatino, serif;\">اصل فاکتور خرید برای مرجوع کردن یک سفارش باید نزد مشتری موجود بوده و امکان تحویل به نماینده مرسیز را داشته باشد.</span></p>\r\n</li>\r\n<li class=\"my-8\" style=\"box-sizing: border-box; margin-top: 0.5rem !important; margin-bottom: 0.5rem !important; line-height: 1.3;\">\r\n<p><span style=\"font-size: 10pt; font-family: georgia, palatino, serif;\">برای هر سفارش فقط یک بار امکان ثبت مرجوعی وجود دارد و بعد از ثبت مرجوعی امکان مرجوعی اقلام دیگر سفارش وجود ندارد.</span></p>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>','returnpolicy',NULL,'2021-03-16 06:09:37'),(4,'<p>هزینه حمل کالا تا خرید بیش از صد هزار تومان به صورت رایگان می باشد و کمتر ازاین خرید مبلغ پنج هزار تومان هزینه حمل دریافت می گردد.</p>\r\n<p>برای پست ویژه مبلغ ده هزار تومان هزینه حمل دریافت میگردد.</p>','transferpolicy',NULL,'2021-03-18 12:31:38'),(5,'<p class=\"MsoNormal\" style=\"text-align: right;\" align=\"right\"><span style=\"font-family: B Nazanin;\">راهنمای سایت به زودی ...</span></p>','guide',NULL,'2021-03-16 06:28:54');
