INSERT INTO `introducing_products` (`id`, `name`, `image`, `description`, `created_at`, `updated_at`) VALUES (2,'مشخصات گوشی موبایل شیائومی Poco X2','1587028664back_login.jpg','مصالح ساختمانی به مواد اولیه گفته می شود که از آن ها در ساخت و تولید بناها و سازه های مختلف استفاده می شود. در ساخت یک بنا مصالح مختلفی به کار می روند که به صورت طبیعی یا مصنوعی و خام یا ترکیبی بوده و هر کدام دارای ویژگی های منحصر بفرد خود می باشند. آشنایی با این مصالح به منظور رسم نقشه های ساختمانی و عمرانی و همچنین اجرای آن ها ضروری است، از این رو افرادی که در حوزه ساخت و ساز فعالیت می کنند باید به خوبی با مواد و مصالح ساختمانی آشنا باشند تا بناای مقاوم و با دوام احداث نمایند . رایج ترین مصالحی که از گذشته تا امروز مورد استفاده قرار گرفته اند و همچنان جایگاه خود را در صنعت معماری و ساختمان سازی حفظ نموده اند چوب، سیمان، فلز، آجر و بتن می باشند. این مواد اولیه به دلیل مقاومت بسیار بالا و هزینه های بصرفه در پروژه های مختلف مورد استفاده قرار می گیرند. در دنیای مدرن امروز مصالح ساختمانی نوین توسط صنعتگران تولید و به بازار عرضه می شوند که در مقایسه با مصالح قدیمی قابلیت ها و مزایای بی شماری دارند. هر یک از این مصالح با توجه به مقاومت و کارایی خود در قسمت های مختلف ساختمان به کار می روند. آنچه که در ادامه این مطلب از سایت با املاک | سامانه خرید و فروش املاک به بیان آن می پردازیم، معرفی انواع مصالح ساختمانی و کاربرد آنهاست. با ما همراه باشید .','2020-04-16 13:47:44','2020-04-16 13:47:44');
