INSERT INTO `posts` (`id`, `title`, `slug`, `content`, `shortContent`, `seoTitle`, `seoContent`, `status`, `imgName`, `imgPath`, `view`, `created_at`, `updated_at`) VALUES (1,'طرز تهیه موهیتو نعنایی با دو روش مختلف','طرز-تهیه-موهیتو-نعنایی-با-دو-روش-مختلف','<p><strong>طرز تهيه موهيتو نعنايي با 2 روش مختلف :</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>روش اول براي تهيه موهيتو:</strong></p>\r\n<p>در اين روش&nbsp; براي تهيه اين نوشيدني خوشمزه تابستاني از شکر استفاده شده&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>مواد لازم براي موهيتو نعنايي&nbsp; :</strong></p>\r\n<p>شکر :يک و نيم پيمانه</p>\r\n<p>برگ نعنا :دو پيمانه</p>\r\n<p>ليمو :يک عدد برا ي تزيين</p>\r\n<p>آب گازدار يا سودا :8 پيمانه</p>\r\n<p>آب :سه پيمانه</p>\r\n<p>شربت ليمو :دو پیمانه</p>\r\n<p>آب ليمو :يک پيمانه</p>\r\n<p><strong>دستور تهيه موهيتو نعنايي :</strong></p>\r\n<p>ابتدا برگ هاي نعنا را از ساقه جدا کرده و داخل تشت آب سرد بريزيد و سپس آن ها را از آب خارج کرده و داخل آبکش بريزيد و کنار بگذاريد . بعد از پاک کردن آن بايد دو پيمانه برگ نعنا داشته باشيد . در اين ميان شکر را با دوسوم آب ترکيب کرده و براي 5 دقيقه در مايکروفر قرار دهيد . بعد از 5 دقيقه مخلوط آب و شکر را از مايکروفر خارج کرده و برگ هاي نعنا را به آن اضافه کنيد و براي 5 دقيقه کنار بگذاريد تا عطر نعنا با شربت ترکيب شود . بعد از 5 دقيقه برگهاي نعنا را از آب خارج کرده و با دست فشار دهيد تا عصاره آن خارج شود سپس آن را کنار بگذاريد .</p>\r\n<p>&nbsp;</p>\r\n<p>در اين مرحله آب باقي مانده را به مخلوط آب و شکر و نعنا اضافه کرده و آب ليمو و شربت ليمو را هم بريزيد و همه مواد را با هم مخلوط نماييد . در مرحله آخريک عدد ليمو را برش هاي نازک بزنيد و به همراه چند عدد برگ نعنا و مقداري يخ داخل يک تنگ بريزيد و شربت را به آن اضافه کنيد . در آخر آب گاز دار را افزوده و بعد از يک هم زدن آن را داخل ليوان بريزيد و سرو نماييد . ميتوانيد يک برش از ليمو را براي تزيين لبه ليوان قرار دهيد .</p>\r\n<p>&nbsp;</p>\r\n<p><strong>روش دوم براي تهيه موهيتو:</strong></p>\r\n<p>در اين روش براي اينکه نوشيدني خاصيت بيشتري داشته باشد و بتواند در فصل گرما ما را از گرما زدگي حفظ کند از عسل استفاده شده است.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>مواد لازم براي موهيتو&nbsp; :</strong></p>\r\n<p>دو عدد ليموترش</p>\r\n<p>يک قاشق غذاخوري عسل</p>\r\n<p>مقداري يخ</p>\r\n<p>8 برگ نعنا + چند برگ براي تزيين</p>\r\n<p>يک قوطي دلستر ليمويي يا آب گاز دار هرکدام که در دسترس بود</p>\r\n<p>&nbsp;</p>\r\n<p><strong>&nbsp;دستور تهيه موهيتو :</strong></p>\r\n<p>ابتدا برگهاي نعنا را شسته و ريز خرد کنيد چند برگ از آن را جدا کرده و براي تزيين کنار بگذاريد و مابقي را خرد نماييد . ليمو ها را شسته و چهار قاچ کنيد و اگر هسته داشت آن را جدا کرده و يک يا دو برش از ليمو را براي تزيين کنار گذاشته و مابقي برش هاي ليمو را به قطعات کوچکتري خرد نماييد . ليموي خرد شده را داخل غذاساز بريزيد و دستگاه را روشن کنيد تا ليمو بخوبي له شده و حالت پوره پيدا کند .</p>\r\n<p>&nbsp;</p>\r\n<p>در ادامه يخ را افزوده و دستگاه را مجدد روشن کنيد تا يخ ها بخوبي خرد شده و با ليمو ترکيب شود سپس عسل را بريزيد و براي چند ثانيه ديگر مواد را هم بزنيد تا بخوبي با هم ترکيب شوند . حالا پوره بدست آمده را به ظرفي منتقل کرده و نعناي خرد شده و آب گاز دار يا دلستر ليمويي را اضافه کنيد و هم بزنيد تا يکدست شود . موهيتوي آماده شده را در ليوان هاي مورد نظر بريزيد و آن ها را با برگهاي نعنا و برش هاي ليمويي که کنار گذاشته بوديد تزيين کنيد و خنک سرو نماييد.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>نکات تکميلي در مورد موهيتو نعنايي:</strong></p>\r\n<p>م<span style=\"font-size: 8pt;\">وهيتو نعنايي جزو نوشيدني - مخلوط ميباشد</span></p>\r\n<p><span style=\"font-size: 8pt;\">زمان آماده سازي مواد اوليه و مايحتاج آن حدودا 20دقيقه</span></p>\r\n<p><span style=\"font-size: 8pt;\">توجه نماييد مقدار مواد اوليه و دستور تهيه براي 4 نفر مناسب ميباشد .</span></p>','طرز تهیه موهیتو نعنایی به دو روش مختلف','موهیتو نعنایی','روش تهیه موهیتو نعنایی','PUBLISHED','شربت سکنجبین..jpg','images/1/554371623474004_شربت سکنجبین..jpg',14,'2021-06-12 05:00:04','2021-09-27 09:58:22'),(2,'نکات پخت مربا بدون کپک و شکرک','نکات-پخت-مربا-بدون-کپک-و-شکرک','<p>پختن مربا در خانه کار سختي است و براي پختن مربا و بدون کپک بايد برخي نکات را بدانيم.</p>\r\n<p>&nbsp;</p>\r\n<h3>1. شيشه هاي استريليزه:</h3>\r\n<p>از ظرف هاي خود بايد کاملا اطمينان داشته باشيد که داري طول عمر خوبي هستند. براي انجام اين کار، ظرف هاي شيشه اي را در آب جوش حداقل 10 دقيقه خيس کنيد. ظرف ها را در آب بگذاريد تا خنک شوند. سپس مي توانيد شيشه ها را با يک چنگال يا يک وسيله اي برداريد (همچنين براي جلوگيري از آلودگي مجدد استريل مي شوند).</p>\r\n<p>&nbsp;</p>\r\n<p>بطري هاي شيشه اي را بر روي يک حوله تميز بگذاريد به همين ترتيب براي درب ها نيز همين کار را ادامه دهيد، زيرا آنها تمايل دارند سريع تر تيره شوند.</p>\r\n<p>&nbsp;</p>\r\n<h3>2. دانه ها و پوست:</h3>\r\n<p>قبل از هرچيز بايد دقت کنيد که ميوه هايي که براي تهيه ي مربا انتخاب مي کنيد سالم و تازه و بدون لک و کرم زدگي باشند. اگر ميوه هاي شما ارگانيک هستند، مي توانيد به طور طبيعي پوست آنها را براي تهيه مرباي خود نگه داريد. در غير اينصورت، بهتر است آنها را پوست بکنيد.</p>\r\n<p>&nbsp;</p>\r\n<p>پس از پوست کندن، ميوه ها را در آب سرد بشوييد و سپس به قطعات کوچک ببريد تا براي پخت آماده شوند. شما همچنين بايد بخش هايي را که خراب يا آسيب ديده اند برداريد ؛در مورد دانه ها، نيازي براي برداشتن آنها نيست.</p>\r\n<p>&nbsp;</p>\r\n<p>دانه سيب، مرکبات يا توت غني از پستين هستند که ضخيم کننده طبيعي است پس براي هضم بهتر دانه ها، يک ترفند ساده وجود دارد، اول رزبرري يا تمشک را فريز کنيد، تمشک يا ساير انواع توت ها را، و سپس آنها را براي تهيه مربا برداريد ؛ اين مرحله دانه ها را مي شکند و آنها را کمتر سفت و سخت مي کند. در اين صورت شما کمتر متوجه سختي آنها مي شويد.</p>\r\n<p>&nbsp;</p>\r\n<h3>3. شکر:</h3>\r\n<p>براي تعيين مقدار مناسب شکر براي حفاظت مناسب از مربايتان، بهتر است قبل از افزودن شکر، ميزان ميوه را وزن کنيد بر اين اساس، مقدار متناسب مورد نيازتان را اضافه کنيد. اگر قصد داريد مربايتان را سريع تر بخوريد، مي توانيد مقدار کمي از شکر را به منظور حفظ طعم اسيديته ميوه ها کاهش دهيد.</p>\r\n<p>&nbsp;</p>\r\n<p>اما در اين مورد، مربا زمان کمي کمتري خواهد ماند. به طور کلي، توصيه مي شود براي يک کيلو ميوه، يک کيلو شکر را اضافه کنيد، اما اگر ميوه شما بسيار شيرين بود، مي توانيد اين مقدار را کاهش دهيد که اغلب 700 گرم شکر براي هر کيلوگرم ميوه مناسب خواهد بود.</p>\r\n<p>&nbsp;</p>\r\n<h3>4. درب ظرف را هنگام پخت مربا نگذاريد:</h3>\r\n<p>هنگام پخت مرباها به جز مرباي به نبايد درب ظرف را بگذاريم چراکه باعث مي شود رنگ مربا تغيير کند .</p>\r\n<p>&nbsp;</p>\r\n<h3>5. نکات زمان مناسب اضافه کردن اسانس در پخت مربا را بدانيد :</h3>\r\n<p>اسانسي که براي معطر کردن مربا استفاده مي شود بايد در اواخر پختن مربا به محتويات افزوده شود تا عطر مورد نظر شما را حفظ کند.</p>\r\n<p>&nbsp;</p>\r\n<h3>6. بهترين ظرف براي پخت مربا:</h3>\r\n<p>تجربه ثابت کرده است که ظرف مورد نظر براي پخت مربا مهم است و شما انواع مرباها به جز مرباي به که بايد داخل ظرف مسي پخته شود را بايد داخل ظرف لعابي يا تفلون درست کرد.</p>\r\n<p>&nbsp;</p>\r\n<h3>7. جلوي شکرک زدن مربا رو بگيريد:</h3>\r\n<p>دليل اينکه مربا شکرک زده جوشيدن زياد است که براي رفع آن بايد مقداري آب جوش داخلش بريزيد و مربا را دو سه جوش دهيد تا يکدست و شکرک رفع شود.</p>\r\n<p>&nbsp;</p>\r\n<h3>8. مربا را نبايد گرم در شيشه بريزيم:</h3>\r\n<p>بهترين کار اين است که مربا را بعد از آنکه پخته شد يک شب نگهداريم، سپس آن را داخل شيشه بريزيم چراکه بعد از يک شب معلوم مي شود که شربت آن رقيق است يا غليظ. دقت داشته باشيد که مربا را بعد از آماده شدن و سرد شدن، بايد داخل شيشه ي در بسته و در جاي خنک نگهداري کرد.</p>\r\n<p>&nbsp;</p>\r\n<h3>9. کپک زدگي مربا را رفع کنيد:</h3>\r\n<p>اگر مربا بعد از مدتي کپک زد به چند دليل است يا آب آن زياد بوده و شربت مربا به اندازه کافي غليظ نشده يا شکر آن کم بوده که بايد در اين صورت مقداري شکر روي آن بريزيد و اجازه دهيد مجددا چند جوش بزند تا غليظ شود.</p>\r\n<p>&nbsp;</p>\r\n<h3>10. به قوام شربت مربا دقت کنيد:</h3>\r\n<p>قوام شربت مربا بسيار مهم است و براي آنکه متوجه شويم شربت قوام آمده کمي از شربت را با قاشق بر ميداريم و اجازه مي دهيم تا سرد شود، اگر شربت حالت کشدار مانند عسل بود و به سختي از قاشق ريخته شد قوام آن خوب است</p>','نکات مهم برای پخت مربا','نکات مهم برای پخت مربا','نکات پخت مربا بدون کپک و شکرک','PUBLISHED','مربامربا.jpg','images/1/495021623474639_مربامربا.jpg',7,'2021-06-12 05:10:39','2021-09-18 08:53:09'),(3,'طرز تهیه شربت خاکشیر','طرز-تهیه-شربت-خاکشیر','<h2>مواد لازم برای شربت خاکشير :&nbsp;</h2>\r\n<p>شکر :1 ليوان</p>\r\n<p>آب خنک :6 ليوان</p>\r\n<p>خاکشير : نصف ليوان</p>\r\n<p>گلاب :2 قاشق غذاخوري</p>\r\n<h3>طرز تهيه شربت خاکشير:&nbsp;</h3>\r\n<p>براي تهيه شربت خاکشير بايد ابتدا با نحوه شستن آن کاملا اگاه باشيد ، چراکه خاکشير ،بدليل ريگ زيادي که داخل آن وجود دارد کمي شستن آن دشوار است و احتياج به زمان و حوصله بيشتر دارد.به همين دليل سعي کنيد در هر سري از شستن خاکشير ، ميزان بيشتري را بشوييد تا هر روز زمان زيادي را براي تميز کردن آن صرف نکنيد.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>حال براي شستن خاکشير دو ظرف گود شفاف برداريد، سپس خاکشير را داخل يکي از ظرف ها بريزيد و روي آن آب سرد بريزيد.بعد از چند ثانيه آب داخل ظزف خاکشير را خالي کنيد و خاکشير را به آرامي داخل ظرف ديگر بريزيد و سعي کنيد انتهاي آن را دور بريزيد.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>مجددا روي خاکشير آب سرد بريزيد و کمي هم بزنيد.وقتي خاکشير کاملا ته نشين شد ، دوباره آب آن را خالي کنيد و خاکشير را به آرامي در ظرف ديگر بريزيد و انتهاي آن که قطعا با ريگ و شن مخلوط است دور بريزيد.اين کار را چندين بار تکرار کنيد تا هم روي آب و هم ته ظرف کاملا شفاف و زلال شود وجز دانه هاي خاکشير چيز ديگري در ظرف نماند.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>در اين حالت يعني خاکشيرآماده ي مصرف است.خاکشير را داخل پارچ آبي بريزيد و به آن شکر و آب اضافه کنيد و خوب هم بزنيد تا شکر کاملا حل شود. در صورت تمايل ميتوانيد شکر و آب را از قبل روي حرارت قرار دهيد تا در اثر گرما شکر زودتر و راحت تر حل شود و بعد از خنک شدن به خاکشير اضافه کنيد. بعد به شربت خاکشير مقداري گلاب و آب ليمو اضافه کنيد تا طعم دلچسب تري بگيرد. همچنين با اضافه کردن چند تکه يخ خرد شده ميتوانيد شربتتان را تگري تر کنيد.</p>\r\n<p>&nbsp;</p>\r\n<h4>چند نکته :&nbsp;</h4>\r\n<p>&nbsp;</p>\r\n<p>اضافه کردن گلاب و ليمو به شربت خاکشير کاملا سليقه اي است.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>در صورت تمايل ميتوانيد از شکر بيشتر و يا کمتري در شربت خاکشير استفاده کنيد.&nbsp;</p>','طرز تهیه شربت خاکشیر','طرز تهیه شربت خاکشیر','طرز تهیه شربت خاکشیر','PUBLISHED','شربت خاکشیر2.jpg','images/1/491471623478325_شربت خاکشیر2.jpg',5,'2021-06-12 06:12:05','2021-09-23 07:07:34'),(4,'ارزش غذایی گیلاس','ارزش-غذایی-گیلاس','<p>ويتامين ث که به عنوان آنتي اکسيدان قوي عمل مي کند در مقادير خوبي از گيلاس وجود دارد. آن ها حاوي چربي هاي، کلسترول يا سديم نيستند و فيبر، ويتامين آ و مواد معدني ضروري مثل آهن، کلسيم و پروتئين دارند همچنين حاوي مقادير قابل توجهي از پتاسيم هستند. علاوه بر اينها گيلاس ها ترکيبات مفيد ديگري مانند بورون، ملاتونين و آنتوسيانين دارند.</p>\r\n<p>&nbsp;</p>\r\n<h3>&nbsp;خواص و مزاياي گيلاس:</h3>\r\n<p>گيلاس سرشار از آنتي سيانين است که به سلامت بدن کمک ميکند. آنتي اکسيدان موجود در آن از اکسايش ناشي از اکسيژن موجود در بدن و خطرات ناشي از راديکال ها جلوگيري ميکند. بدن ما روزانه به حداقل 3000 تا 5000 سلول دهاني نياز دارد تا اکسيژن مورد نياز خون را تامين کند.</p>\r\n<p>&nbsp;</p>\r\n<h3>گيلاس براي بهبود خواب :</h3>\r\n<p>گيلاس، ده برابر بيشتر از تمشک و توت فرنگي ملاتونين دارد که بي خوابي را درمان ميکند و کارايي مفصل ها را بهبود ميبخشد. همچنين درمان خوبي براي جت لگ (خستگي ناشي از پرواز) است.</p>\r\n<p>&nbsp;</p>\r\n<h3>گيلاس براي خون سازي :</h3>\r\n<p>اين ميوه علاوه بر خون سازي انرژي مورد نياز بدن را نيز تامين ميکند و سديم موجود در آن انعطاف از دست رفته را باز ميگرداند.</p>\r\n<p>&nbsp;</p>\r\n<h3>جلوگيري از آلزايمر با مصرف گيلاس :</h3>\r\n<p>مشخص شده است که ترکيب گيلاس در رژيم غذايي مي تواند به فرد کمک کند تا با نشانه هاي بيماري آلزايمر مقابله کند. بسياري از پزشکان گيلاس ها را به افرادي که مبتلا به آلزايمر هستند توصيه کرده اند اين به خاطر حضور مقادير خوب آنتي اکسيدان است.</p>\r\n<p>&nbsp;</p>\r\n<h3>گيلاس کاهش دهنده درد :</h3>\r\n<p>گيلاس درد عضلاني را کاهش ميدهد و براي افرادي که تمرينات ورزشي سخت انجام ميدهند، بسيار مفيد است.</p>\r\n<p>&nbsp;</p>\r\n<h3>مصرف گيلاس براي تسکين ميگرن:</h3>\r\n<p>اين ميوه به دليل اينکه حاوي آنتي سيانين و بيوفلاونوئيد است، به درمان ميگرن کمک ميکند.</p>\r\n<p>&nbsp;</p>\r\n<h3>گيلاس براي سرماخوردگي:</h3>\r\n<p>آنتي اکسيدان ها و ويتامين C موجود در گيلاس سيستم ايمني بدن را تقويت مي کند و از ابتلا به سرماخوردگي، آنفلونزا، تب، سرفه و عفونت هاي باکتريايي، ويروسي و قارچي جلوگيري مي کند.</p>\r\n<p>&nbsp;</p>\r\n<h3>فوايد گيلاس براي معده و دستگاه گوارش:</h3>\r\n<p>فيبر موجود در گيلاس هضم غذا را بهبود مي بخشد و معده درد را درمان کرده وبه سلامت دستگاه گوارش کمک مي کند.</p>','ارزش غذایی گیلاس','ارزش غذایی گیلاس','فواید گیلاس برای بدن','PUBLISHED','گیلاس.jpg','images/1/226611623478721_گیلاس.jpg',20,'2021-06-12 06:17:48','2021-10-15 19:20:06');
