\"box-sizing: border-box; color: #109f7a; text-decoration-line: none;\" href=\"../foodstuffs\">انواع مواد غذایی</a>،&nbsp;<a style=\"box-sizing: border-box; color: #109f7a; text-decoration-line: none;\" href=\"../drinks-herbaltea\">نوشیدنی و دم&zwnj;نوش&zwnj;ها</a>،&nbsp;<a style=\"box-sizing: border-box; color: #109f7a; text-decoration-line: none;\" href=\"../cosmetics-hygiene\">محصولات بهداشتی زیبایی</a>،&nbsp;<a style=\"box-sizing: border-box; color: #109f7a; text-decoration-line: none;\" href=\"../tools-essentials\">انواع ابزار و ملزومات</a>&nbsp;را با تخفیف مناسب در فروشگاه اینترنتی تهیه کنید. ، با استفاده از روش&zwnj;های پرداخت آسان، ویترین عالی و طرح&zwnj;های تخفیفی بی&zwnj;نظیر در وب&zwnj;سایت، امکان خرید با قیمت و تخفیف مناسب را برای همه مشتریان عزیز به وجود آورده است. با سوپرمارکت آنلاین می&zwnj;توانید کالاهای اساسی را با تضمین کمترین قیمت ممکن و بهترین خدمات پس از فروش درب منزلتان تحویل بگیرید. ویترین فروشگاه اینترنتی شامل کالاهای اساسی موردنیاز شما در انواع برندها و مارک&zwnj;های ایرانی و خارجی باکیفیت و تخفیف عالی است. در این فروشگاه اینترنتی مواد غذایی می&zwnj;توانید انواع مارک&zwnj;های&nbsp;<a style=\"box-sizing: border-box; color: #109f7a; text-decoration-line: none;\" href=\"../rice\">برنج</a>،&nbsp;<a style=\"box-sizing: border-box; color: #109f7a; text-decoration-line: none;\" href=\"../hot-drinks/tea-herbaltea\">چای</a>،&nbsp;<a style=\"box-sizing: border-box; color: #109f7a; text-decoration-line: none;\" href=\"../oil/\">روغن</a>،&nbsp;<a style=\"box-sizing: border-box; color: #109f7a; text-decoration-line: none;\" href=\"../sugar-cube-sugar-rockcandy/sugarcube-sugar\">قند و شکر</a>،&nbsp;<a style=\"box-sizing: border-box; color: #109f7a; text-decoration-line: none;\" href=\"../proteins\">محصولات پروتئینی</a>&nbsp;و&nbsp;<a style=\"box-sizing: border-box; color: #109f7a; text-decoration-line: none;\" href=\"../dairy-products\">لبنیاتی</a>،&nbsp;<a style=\"box-sizing: border-box; color: #109f7a; text-decoration-line: none;\" href=\"../legume\">انواع حبوبات</a>&nbsp;و&nbsp;<a style=\"box-sizing: border-box; color: #109f7a; text-decoration-line: none;\" href=\"../condiment-spice\">ادویه&zwnj;جات</a> را به همراه صدها محصول دیگر را در کیفیت و با خدمات عالی به&zwnj; صورت اینترنتی و با پرداخت آنلاین یا حضوری، در کمترین بازه زمانی ممکن دریافت کنید. تمام محصولات ارائه&zwnj;شده در این سوپرمارکت آنلاین دارای مجوز و استانداردهای لازم از وزارت بهداشت و مراجع مربوطه بوده و تاریخ&zwnj;مصرف هر کالای ارسالی به&zwnj; صورت مجزا کنترل می&zwnj;شود. فروشگاه اینترنتی مواد غذایی تضمین می&zwnj;کند علاوه بر تخفیف&zwnj;های روزانه فروشگاه&zwnj;، بیشترین تخفیف&zwnj;ها را با خرید آنلاین از سوپر مارکت آنلاین دریافت کنید.</div>\r\n</div>',NULL,'text_editor',NULL,'2021-08-01 05:36:50'),(19,'واحد پول','currency','تومان','ریال/تومان','select',NULL,'2021-01-25 11:52:49'),(20,'Merchant ID zarinpal','MerchantID_zarinpal',NULL,NULL,'text',NULL,'2021-08-01 05:36:50'),(21,'نوع درگاه پرداخت','zarinpal_client','پرداخت آزمایشی','پرداخت آزمایشی/درگاه پرداخت','select',NULL,'2021-08-01 05:36:50'),(22,'درصد خرید از لینک بازاریابی','Marketing_darsad','1',NULL,'number',NULL,'2021-08-01 05:36:50'),(23,'مقدار تخفیف برای خرید اول (درصد)','first_buy_mony','10',NULL,'number',NULL,'2021-08-01 05:36:50'),(24,'لوکیشن','map','LatLng(36.29327, 50.01157)',NULL,'map',NULL,'2021-08-01 05:36:50'),(25,'Api Map','Api_map','eyJ0eXAiOiJKV1QiLCJhbGciOiJSUzI1NiIsImp0aSI6IjFkOWM0ZWUyNjBhN2M3NDcyMzE4YmI1MWRhNmMxMjBjYjIxNDRhMmMzNGY1ZDZjZDQyNDgxOGE1NzI3MDliOTJkNWE3YTczNTNhY2E1OTYwIn0.eyJhdWQiOiIxMjUxMSIsImp0aSI6IjFkOWM0ZWUyNjBhN2M3NDcyMzE4YmI1MWRhNmMxMjBjYjIxNDRhMmMzNGY1ZDZjZDQyNDgxOGE1NzI3MDliOTJkNWE3YTczNTNhY2E1OTYwIiwiaWF0IjoxNjExNjU1Njk5LCJuYmYiOjE2MTE2NTU2OTksImV4cCI6MTYxNDE2MTI5OSwic3ViIjoiIiwic2NvcGVzIjpbImJhc2ljIl19.aIXkKNdVCsxRVYzGZJQQnQgQ358_ClAMMLnEIH2o8KojXJYwArNFV8KlimaW0pH38pmOjYfT-3AqcRPP8DuhUYsKJ6AcMvWnhMY7gqW6TztXJJ0eioEt1d4eM4r0f0T5084cLQT6eWOWYfuwVUQcVaVK4U2A8Zs3jZMJBZqontxUgMJt8SzCajlr8zIDXlEkhZedT9uZuQSarsa7hmzMdJJ_H5cXo4BAbOByuwWyiKU0LEtenCGJCABAaz8ajpPbeEP